import React from 'react';

function HeaderNav() {

    function toggleMenu() {
        var navMenu = document.getElementById("navMenu");
        navMenu.classList.toggle("open"); // Adiciona ou remove a classe "open"
      }

    return <div>
        <div className='HeaderNav'>
        <div className="menu-icon" onClick="toggleMenu()">
         &#9776; 
            </div>
            <nav id="navMenu" class="nav-links">
                <a href="#BannerBox">QUEM SOMOS</a>
                <a href="#ServicosBox">SERVIÇOS</a>
                <a href="#agendeseuhorariobox">AGENDE SEU HORÁRIO</a>
                <a href="#redes">CONTATOS</a>
            </nav>
        </div>
    </div>
}

export default HeaderNav;
